import React from 'react';

const ArticleCard = ({article}) => {
  return (
    <div>
      <li>
        <h3>
          {article.title}
        </h3>
        <h4>
          {article.author}, {article.topic}
        </h4>
        <h5>
          {article.created_at}
        </h5>
      </li>
    </div>
  );
};

export default ArticleCard;
